import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be rendered by the script
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take a screenshot after products are visible
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_visible.png'));

    // Extract all product prices
    const prices = await page.$$eval('.product-price', elements =>
      elements.map(el => {
        // The innerText might contain both the current and original price.
        // We split by whitespace and take the first element that starts with '$'.
        const textContent = el.innerText.trim();
        const priceParts = textContent.split(/\s+/);
        return priceParts.find(part => part.startsWith('$')) || null;
      })
    );

    // Filter out any null values in case an element was empty
    const cleanedPrices = prices.filter(price => price !== null);

    return {
      success: true,
      action: "Extracted all visible product prices from the page.",
      extractedData: {
        productPrices: cleanedPrices,
        priceCount: cleanedPrices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
